import React, {useState} from 'react';
import ReactMapGL from 'react-map-gl';
import "../../.env"
import './mappage.scss';
import 'mapbox-gl/dist/mapbox-gl.css';

export default function MapPage() {
    const [viewport, setViewport] = useState({
        width: "100%",
        height: "100%",
        latitude: -86.921195,
        longitude: 40.423705,
        zoom: 4
    });
    const handleSubmit = (event) =>{
        event.preventDefault();
    }
  return (
    <div>
        <div className="mapPage">
            <div className="left">
                <h1 className = "header">Create a Event!</h1>
                <form autoComplete = "off" validate = "true" className = "form" onSubmit = {handleSubmit}>
                    <input className = "input"></input>
                    <input className = "input"></input>
                    <input className = "input"></input>
                </form>
            </div>
            <div className="right">
            <ReactMapGL
                {...viewport}
                mapboxApiAccessToken = "pk.eyJ1IjoidmlzdnNoYWgiLCJhIjoiY2w4NjUyMjRoMGc2bTN2bHRqYmY0YWM0OCJ9.agwVWoRab0Fy-Qt-xesrEA"
                onViewportChange = {nextViewport => setViewport(nextViewport)}
                />
            </div>
        </div>
    </div>
  )
}
